import "./Hero.css";

function Hero() {
  return (
    <section id="home" className="hero">
      <div className="hero-content">
        <h1>Hello , Iam Shams Alwadiya </h1>
        <p>
        I am a dedicated Frontend Developer with a strong focus on building scalable and maintainable web interfaces using React.js.
         My work emphasizes clean code, performance optimization, and creating responsive, accessible user experiences.
         I continuously strive to stay up to date with the latest web technologies and best practices to deliver high-quality solutions that meet both user needs and business goals.</p>
        <button className="cta-button" ><a href=""></a>Browse my work 
        </button>
      </div>
    </section>
  );
}

export default Hero;
